import { Pants } from 'graphql/Pants';
import { ItemProp } from './ItemProp';

type Props = {
  pants: Pants;
};

export const PantsItem: React.FunctionComponent<Props> = ({ pants }: Props) => {
  return (
    <div>
      <ItemProp label="Type">{pants.type}</ItemProp>
      <ItemProp label="Name">{pants.name}</ItemProp>
      <ItemProp label="Color">{pants.color}</ItemProp>
      <ItemProp label="Width">{pants.width}</ItemProp>
      <ItemProp label="Length">{pants.length}</ItemProp>
    </div>
  );
};
